sys_ui_script.script:
var sw = '/x_snc_coolconf19.service_worker.jsdbx';

if ('serviceWorker' in navigator) {
	//update page with link to manifest file
	document.write('<link rel="manifest" href="/x_snc_coolconf19.manifest.json.jsdbx">');
	window.addEventListener('load', function() {
		navigator.serviceWorker.register(sw, { scope: '/coolconf19'
											 }).then(function(registration) {			
			// Registration was successful
			console.log('ServiceWorker registration successful with scope: ', registration.scope);
		}, function(err) {
			// registration failed :(
			console.log('ServiceWorker registration failed: ', err);
		});
	});
}
